import React from 'react';

class CMS extends React.Component {

   constructor(props) {
      super(props);

      this.state = {
         dataList: []
      }
   }

   render() {
      const url = 'http://localhost:5000/api/letters/';

      fetch(url)
      .then((res) => {
         console.log(res);
         this.setState({
            dataList: res
         })
      })

      return (
         <div>
            <h2>CMS</h2>
            {/* {this.state.dataList} */}
         </div>
      )
   }
}

export default CMS;
